import React from "react";
import "./Plans.css";

const Plans = () => {
	return (
		<div className="plans__container">
			<div className="programs-header" style={{ gap: "2rem" }}>
				<span>READY TO START </span>
				<span>YOUR JOURNEY</span>
				<span>NOW WITH US</span>
			</div>
		</div>
	);
};

export default Plans;
